import React, { Component } from "react";

class Contact extends Component {
  render() {
    return (
      <div>
        <h2>GOT QUESTIONS?</h2>
        <p>The easiest thing to do is post on
        our <a href="https://docs.google.com/document/d/1wnYdfvV-RPM3314hZAS7WRRR4oRWiKbb_uwv1vpOtiQ/edit?usp=sharing">forums</a>.
        </p>
		<p>If there is something that you want to talk about! Contact us at <b>+91 9739386282</b></p>
      </div>
    );
  }
}

export default Contact;
